async function unzipWebpFromDataUri(dataUri) {
    const blobUrls = {};

   
    const base64 = dataUri.split(',')[1];
    const binaryString = atob(base64);
    const len = binaryString.length;
    const bytes = new Uint8Array(len);
    for (let i = 0; i < len; i++) {
        bytes[i] = binaryString.charCodeAt(i);
    }

    //Load the zip
    const zip = await JSZip.loadAsync(bytes);


    for (const [filename, file] of Object.entries(zip.files)) {
    if (!file.dir) {
        let mime = '';

        if (filename.endsWith('.js') || filename.endsWith('.mjs')) {
            mime = 'text/javascript';
        } else if (filename.endsWith('.css')) {
            mime = 'text/css';
        } else if (filename.endsWith('.html')) {
            mime = 'text/html';
        } else if (filename.endsWith('.webp')) {
            mime = 'image/webp';
        } else if (filename.endsWith('.png')) {
            mime = 'image/png';
        } else if (filename.endsWith('.jpg') || filename.endsWith('.jpeg')) {
            mime = 'image/jpeg';
        }
      

        const rawBlob = await file.async("blob");
        const blob = mime ? new Blob([rawBlob], { type: mime }) : rawBlob;

        const blobUrl = URL.createObjectURL(blob);
        console.log(filename);
        blobUrls[filename] = blobUrl;
    }
}


    return blobUrls;

body { 
    position: relative;
}

.pixelated {
	image-rendering: optimizeSpeed;             /* STOP SMOOTHING, GIVE ME SPEED  */
    image-rendering: -moz-crisp-edges;          /* Firefox                        */
    image-rendering: -o-crisp-edges;            /* Opera                          */
    image-rendering: -webkit-optimize-contrast; /* Chrome (and eventually Safari) */
    image-rendering: pixelated; /* Chrome */
    image-rendering: optimize-contrast;         /* CSS3 Proposed                  */
    -ms-interpolation-mode: nearest-neighbor;   /* IE8+  */
}

#container {
	width: 100%;   /*                             JAB */
    height: 100%;  /*                             JAB */
    position: fixed; /* Ensure it fills the viewport - JAB */
    top: 0;        /*                             JAB */
    left: 0;       /*                             JAB */
    overflow: hidden; /* Prevent scrollbars within the container - JAB */
    box-shadow: #31b8e0 0px 0px 50px;
}

#wrapper {
    width: 100%;
    height: 100%;
    position: relative; /* Ensure it doesnt collapse */
	min-height: 100vh;
	overflow: hidden; /* Prevent any potential overflow - JAB*/
}

#build-number {
    position: fixed;
    bottom: 10px;
    right: 10px;
    font-size: 12px;
    color: #ffffff;
    background: rgba(0, 0, 0, 0.5);
    padding: 5px 10px;
    border-radius: 5px;
    z-index: 1000;
    pointer-events: none;
}
